import Countdown from 'react-countdown'

function TimeOver(){
    return <h1>Time Over</h1>
}

class Timer extends Component{


Completionist() {
    <TimeOver />
}


    render()
     {
        return (<div>
            <h1>
                <Countdown date={Date.now() + 10000} onComplete={(e)=>this.Completionist(e)}>

                </Countdown>

            </h1>
        </div>)

    }
}


export default Timer;
